import React from "react";
import { earth } from "../Images/mid-earth.png";

export default function HeroSection() {
  return (
    <div className="container">
      <h2 className="object" data-value="3">
        My Text
      </h2>
      <img src={earth} alt="" />
    </div>
  );
}
